var vSignupForm=new Vue({el:"#signupForm",data:{amount:"",title:"",fname:"",lname:"",email:"",mobile:""},created:function(){$(".loader").fadeOut(400)},computed:{isValid:function(){return!this.errors.any()&&""!=this.amount&&""!=this.fname&&""!=this.lname&&""!=this.title&&""!=this.email&&""!=this.mobile}},methods:{onSubmit:function(){this.errors.any()||this.$http.post("/api/posts",this.$data).then(function(t){document.location.href="/first-login"},function(t){document.location.href="/info?message="+t.body.message})}}});